import React from 'react';
import './Gallery.css';

function Gallery() {
    return (
        <section className="gallery">
            <h2>Our Gallery</h2>
            <div className="gallery-images">
                <img src="/Assets/7.jpeg" alt="Gallery Image 1" />
                <img src="/Assets/9.jpeg" alt="Gallery Image 2" />
                <img src="/Assets/7.jpeg" alt="Gallery Image 3" />
            </div>
        </section>
    );
}

export default Gallery;
